import {v4 as uuid} from "uuid";

const specialtyCocktails = [
    {
        id: uuid(),
        name: 'RH-',
        description: `Tanqueray londnon dry \nOrange juice \n' +
            Lime juice \n
            Angostura Orange bitters`,
        price: '',
    },
]

export const drinkMenu = [
    {
        id: uuid(),
        title: 'Specialty cocktails',
        type: specialtyCocktails,
    },
]
